import React, { useState } from 'react'

// hooks
// import {useForm} from 'react-hook-form'

//Components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  CardTitle,
  Label,
  FormGroup,
  Form,
  Input,
  FormText,
  Row,
  Col
} from 'reactstrap'
import Select from 'react-select'

function UsersList() {
  const [businessName, setBusinessName] = useState(false)
  const [category, setCategory] = useState(false)
  const [city, setCity] = useState(false)
  const [branches, setBranches] = useState(false)
  const [fullName, setFullName] = useState(false)
  const [position, setPosition] = useState(false)
  const [mobileNo, setMobileNo] = useState(false)

  const handleSubmit = () => {

  }

  return (
    <>
       <div
          className="header"
          style={{
            display: "flex",
            justifyContent: "space-between",
            flexDirection: "row"
          }}
        >
          <h3
            style={{
              color: "#CACACA",
              fontSize: 22,
              fontFamily: "Libre Caslon Tex"
            }}
          >
            Active Engagement History
          </h3>
          <div
            className="header"
            style={{ display: "flex", alignItems: "center" }}
          >
            <UncontrolledDropdown>
              <DropdownToggle
                aria-haspopup={true}
                // caret
                color="default"
                data-toggle="dropdown"
                id="navbarDropdownMenuLink"
                nav
              >
                <img
                  style={{
                    height: 42,
                    width: 115,
                    marginLeft: "20px"
                    // marginRight: "12px"
                  }}
                  src={require("assets/img/filter.png")}
                />
              </DropdownToggle>
              <DropdownMenu
                persist
                aria-labelledby="navbarDropdownMenuLink"
                right
              >
                <div style={{ margin: 10, width: 326 }}>
                  <InputGroup style={{}}>
                    <Input
                      placeholder="Search"
                      type="text"
                      // onChange={e => handleOnChange("password", e.target.value)}
                    />
                    <InputGroupAddon addonType="prepend">
                      <InputGroupText>
                        <img
                          style={{
                            height: 16,
                            width: 16,
                            marginLeft: "20px"
                            // marginRight: "12px"
                          }}
                          src={require("assets/img/search.png")}
                        />
                      </InputGroupText>
                    </InputGroupAddon>
                  </InputGroup>
                  <h6
                    style={{
                      color: "#808080",
                      fontSize: "14px",
                      marginTop: "20px"
                    }}
                  >
                    Custom Time
                  </h6>
                  <div style={{ display: "flex" }}>
                    <InputGroup style={{ margin: 5 }}>
                      <Input
                        placeholder="-From"
                        type="date"
                        // onChange={e => handleOnChange("password", e.target.value)}
                      />
                    </InputGroup>
                    <InputGroup style={{ margin: 5 }}>
                      <Input
                        placeholder="-To"
                        type="date"
                        // onChange={e => handleOnChange("password", e.target.value)}
                      />
                    </InputGroup>
                  </div>
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      alignItems: "center",
                      marginTop: "30px"
                    }}
                  >
                    <Button
                      className="btn-link"
                      color="secondary"
                      style={{ color: "#3A0F7D" }}
                    >
                      <img
                        style={{
                          height: 12,
                          width: 12,
                          // marginLeft: "20px"
                          marginRight: "5px"
                        }}
                        src={require("assets/img/cross.png")}
                      />
                      Clear
                    </Button>
                    <img
                      style={{
                        height: 42,
                        width: 115,
                        marginLeft: "20px",
                        marginRight: "5px"
                      }}
                      src={require("assets/img/apply.png")}
                    />
                  </div>
                </div>
              </DropdownMenu>
            </UncontrolledDropdown>
            <UncontrolledDropdown>
              <DropdownToggle
                aria-haspopup={true}
                // caret
                color="default"
                data-toggle="dropdown"
                id="navbarDropdownMenuLink"
                nav
              >
                <img
                  style={{
                    height: 42,
                    width: 152,
                    // marginLeft: "20px"
                    marginRight: "20px"
                  }}
                  src={require("assets/img/moreAction.png")}
                />
              </DropdownToggle>
              <DropdownMenu
                persist
                aria-labelledby="navbarDropdownMenuLink"
                right
              >
                <DropdownItem
                  style={{
                    color: "#3A0F7D",
                    fontFamily: "Khula",
                    fontSize: 15
                  }}
                  href="#pablo"
                  onClick={e => e.preventDefault()}
                >
                  Request Hours
                </DropdownItem>
                <DropdownItem
                  style={{
                    color: "#3A0F7D",
                    fontFamily: "Khula",
                    fontSize: 15
                  }}
                  href="#pablo"
                  onClick={e => e.preventDefault()}
                >
                  Request Engagement
                </DropdownItem>
                <DropdownItem
                  style={{
                    color: "#3A0F7D",
                    fontFamily: "Khula",
                    fontSize: 15
                  }}
                  href="#pablo"
                  onClick={e => e.preventDefault()}
                >
                  End Engagement
                </DropdownItem>
                <DropdownItem
                  style={{
                    color: "#3A0F7D",
                    fontFamily: "Khula",
                    fontSize: 15
                  }}
                  href="#pablo"
                  onClick={e => e.preventDefault()}
                >
                  Manage Engagement Hour
                </DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>
          </div>
        </div>
    </>
  )
}

export default UsersList
